import GitSrvices from "./GitHubService/GitHubService";
import UI from "./UI";

const data = new GitSrvices();
const message = new UI();
const input   = document.querySelector('input');
input.addEventListener('keydown', (e)=>{

  const value = e.target.value;
  if(value !== ''){
    data.getUser(value)
      .then(res=>{

          console.log(res)

      })
  }
});
